import React, { useState, useCallback } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { 
  Box, 
  TextField, 
  Button, 
  CircularProgress, 
  Snackbar, 
  Alert, 
  Typography,
  Paper,
  Stepper,
  Step,
  StepLabel,
  Link,
  Container
} from '@mui/material';
import type { RootState } from '../../store';
import { setAccessToken, setError as setAuthError } from '../../store/slices/authSlice';
import { marketDataApi, ApiError } from '../../services/api/marketDataApi';

const steps = [
  'Login to Kite',
  'Generate Access Token',
  'Enter Token'
];

export const AccessTokenInput: React.FC = () => {
  const dispatch = useDispatch();
  const { isAuthenticated, loading: authLoading, error: authError } = useSelector((state: RootState) => state.auth);
  const [token, setToken] = useState('');
  const [loading, setLoading] = useState(false);
  const [successMessage, setSuccessMessage] = useState('');
  const [errorDetails, setErrorDetails] = useState<string | null>(null);
  const [activeStep, setActiveStep] = useState(2); // Start at the token input step

  const validateTokenFormat = (token: string): boolean => {
    if (token.length < 32) {
      setErrorDetails('Token seems too short. Kite tokens are typically 32 characters or longer.');
      return false;
    }
    if (!/^[A-Za-z0-9]+$/.test(token)) {
      setErrorDetails('Token should only contain letters and numbers.');
      return false;
    }
    return true;
  };

  const handleSubmit = useCallback(async (event: React.FormEvent) => {
    event.preventDefault();
    setLoading(true);
    setErrorDetails(null);

    if (!validateTokenFormat(token)) {
      setLoading(false);
      return;
    }

    try {
      const response = await marketDataApi.validateToken(token);
      if (response.status === 'success') {
        dispatch(setAccessToken(token));
        setSuccessMessage('Token verified successfully!');
        setActiveStep(3); // Move to completed state
      } else {
        throw new Error('Token verification failed');
      }
    } catch (error) {
      const apiError = error as ApiError;
      setErrorDetails(apiError.message || 'Failed to verify token. Please try again.');
      dispatch(setAuthError(apiError.message || 'Authentication failed'));
    } finally {
      setLoading(false);
    }
  }, [token, dispatch]);

  return (
    <Container maxWidth="md">
      <Paper elevation={3} sx={{ p: 4, mt: 4 }}>
        <Typography variant="h4" gutterBottom align="center" color="primary">
          Kite Authentication
        </Typography>

        <Stepper activeStep={activeStep} sx={{ mb: 4 }}>
          {steps.map((label) => (
            <Step key={label}>
              <StepLabel>{label}</StepLabel>
            </Step>
          ))}
        </Stepper>

        <Box component="form" onSubmit={handleSubmit} sx={{ mt: 2 }}>
          {activeStep === 2 && (
            <>
              <Typography variant="body1" gutterBottom>
                To get your access token:
              </Typography>
              <ol>
                <li>
                  <Typography variant="body2" gutterBottom>
                    Login to your <Link href="https://kite.zerodha.com/" target="_blank" rel="noopener">Kite account</Link>
                  </Typography>
                </li>
                <li>
                  <Typography variant="body2" gutterBottom>
                    Go to <Link href="https://kite.trade/connect/login" target="_blank" rel="noopener">Kite Connect</Link>
                  </Typography>
                </li>
                <li>
                  <Typography variant="body2" gutterBottom>
                    Generate and copy your access token
                  </Typography>
                </li>
              </ol>

              <TextField
                fullWidth
                label="Access Token"
                variant="outlined"
                value={token}
                onChange={(e) => setToken(e.target.value)}
                error={!!errorDetails}
                helperText={errorDetails}
                sx={{ mt: 2 }}
                disabled={loading}
              />

              <Button
                type="submit"
                variant="contained"
                fullWidth
                disabled={loading || !token}
                sx={{ mt: 2 }}
              >
                {loading ? <CircularProgress size={24} /> : 'Verify Token'}
              </Button>
            </>
          )}

          {activeStep === 3 && (
            <Alert severity="success" sx={{ mt: 2 }}>
              {successMessage}
            </Alert>
          )}
        </Box>
      </Paper>

      <Snackbar 
        open={!!authError} 
        autoHideDuration={6000} 
        onClose={() => dispatch(setAuthError(null))}
      >
        <Alert severity="error" onClose={() => dispatch(setAuthError(null))}>
          {authError}
        </Alert>
      </Snackbar>
    </Container>
  );
};
